  hasLinkedIn: boolean,
  linkedInLink: string
}

interface GithubProps {
  hasGithub: boolean,
  githubLink: string
}

interface DisplayProps {
  name: string,
  hasLinkedIn: boolean,
  hasGithub: boolean,
  linkedInLink: string,
